ownedComment.body:
// Trans-temporal fact in plain OCL in the Growing Block View: people should not be descendants/ancestors of themselves

context _'Biological Person'
inv: self-&gt;asSet()-&gt;closure(children)-&gt;excludes(self)

// Initial Classification Rule in Temporal OCL: first phase of a person should be Child

context Person 
temp initialChild: World.allInstances()-&gt;exists(w | self.exists(w) and w.allPrevious()-&gt;forAll(p| not self.existsIn(p)) implies self.oclIsKindOf(Child, w))

// Final Classification Rule in Temporal OCL: for every person, for every world, if that instance is an Elder at that world, then for every world after that, if the instance exists, then it instantiates Elder or does to exist. In other words, there is no other allowed classification for it before ceasing to exist

context Person 
temp finalElder: World.allInstances()-&gt;forAll(w | self.oclIsKindOf(Elder, w) implies w.allNext()-&gt;forAll(n | not self.existsIn(n) or self.oclIsKindOf(Elder, n)))

